Creating a direct equivalent of this class in Swift for iOS is not straightforward due to differences in the way Android and iOS handle graphics and drawing. However, I can provide a Swift class that achieves a similar result using `CALayer` and `UIView`.

Here's a Swift class that stacks two images and scales them to a specific size:

```swift
import UIKit

class StackedImagesView: UIView {
    private var iconScale: CGFloat = 0.7
    private var image1: UIImage?
    private var image2: UIImage?

    init(image1: UIImage, image2: UIImage, iconScale: CGFloat = 0.7) {
        self.image1 = image1
        self.image2 = image2
        self.iconScale = iconScale
        super.init(frame: .zero)
        setupLayers()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupLayers() {
        let image1Layer = CALayer()
        let image2Layer = CALayer()

        image1Layer.contents = image1?.cgImage
        image2Layer.contents = image2?.cgImage

        layer.addSublayer(image1Layer)
        layer.addSublayer(image2Layer)

        updateLayers()
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        updateLayers()
    }

    private func updateLayers() {
        guard let image1 = image1, let image2 = image2 else { return }

        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = (newWidth - iconsSize) - 1

        let image1Layer = layer.sublayers?[0]
        let image2Layer = layer.sublayers?[1]

        image1Layer?.contentsGravity = .resizeAspectFill
        image2Layer?.contentsGravity = .resizeAspectFill

        image1Layer?.bounds = CGRect(x: 0, y: 0, width: iconsSize, height: iconsSize)
        image1Layer?.position = CGPoint(x: iconsInset, y: iconsInset)

In TypeORM, you can use the `json` or `jsonb` data type to store JSON data in a PostgreSQL database. Here's how you can define it in your TypeORM entity:

```typescript
import { Entity, PrimaryGeneratedColumn, Column } from "typeorm";

@Entity()
export class MyEntity {

    @PrimaryGeneratedColumn()
    id: number;

    @Column({ type: "json" }) // or "jsonb"
    data: any;
}
```

The main difference between `json` and `jsonb` is that `jsonb` supports indexing, which can lead to more efficient searches. However, it also takes up more storage space. If you don't need to index the JSON data, `json` might be a better choice.
